      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 IN ( + 19 * + 47 + col2 + col1, - CAST ( - 85 AS INTEGER ), CAST ( + 46 AS INTEGER ) + - col0, - 47 / - col1 );
  - name: tab1

outputs:
  - name: q13145.out
    data: |
      51	14	96
      85	5	59
      91	47	68
